<div style="position:absolute;left:94.56px;top:411.35px" class="cls_008"><span class="cls_008">2.1</span></div>
<div style="position:absolute;left:116.90px;top:411.71px" class="cls_008"><span class="cls_008">Transitions to the new MPERS Framework</span></div>
<div style="position:absolute;left:94.56px;top:439.79px" class="cls_009"><span class="cls_009">For the current year ended 31 december {{$CURRENTYEAR}}, the Company has adopted the new Malaysian</span></div>
<div style="position:absolute;left:94.56px;top:453.59px" class="cls_009"><span class="cls_009">Private Entities Reporting Standard (MPERS). The date of transition to the new MPERS Framework</span></div>
<div style="position:absolute;left:94.56px;top:481.55px" class="cls_009"><span class="cls_009">Adoption of the new MPERS Framework requires that all the Standard in MPERS be applied to the</span></div>
<div style="position:absolute;left:94.56px;top:498.02px" class="cls_009"><span class="cls_009">financial statements for the current year ended 31 December {{$CURRENTYEAR}}, the comparative financial</span></div>
<div style="position:absolute;left:94.56px;top:514.58px" class="cls_009"><span class="cls_009">statement for the year ended 31 January {{$CURRENTYEAR}}, and to the opening statement of financial position at</span></div>
